import React, { Component } from "react";

class Work extends Component {
  state = {};
  render() {
    return (
      <div className="row">
        <div className="col-sm-12 col-lg-5">
          <div class="shadow">
            <img
              src="../../imgs/web-development.png"
              class="img-fluid"
              alt=""
              width="100%"
              height="auto"
            />
          </div>
        </div>
      </div>
    );
  }
}

export default Work;
